import React from "react";
import { FaTwitter, FaInstagram, FaLinkedin, FaFacebook, FaYoutube } from "react-icons/fa";

function Footer() {
  const social = [
    { Icon: FaTwitter, url: "https://twitter.com/zerodhaonline" },
    { Icon: FaInstagram, url: "https://instagram.com/zerodhaonline" },
    { Icon: FaLinkedin, url: "https://linkedin.com/company/zerodha" },
    { Icon: FaFacebook, url: "https://facebook.com/zerodhaonline" },
    { Icon: FaYoutube, url: "https://youtube.com/zerodhaonline" },
  ];

  return (
    <div className="footer bg-dark text-light pt-5">
      <div className="container">
        <div className="row">
          {/* Column 1 */}
          <div className="col-md-3 mb-4">
            <img
              src="https://zerodha.com/static/images/logo.svg"
              alt="Zerodha Logo"
              height="25"
              className="mb-3"
            />
            <p style={{ fontSize: "13px", fontWeight: "500" }}>
              © 2010 - 2025, Zerodha Broking Ltd.
              <br />
              All rights reserved.
            </p>
          </div>

          {/* Column 2 */}
          <div className="col-md-2 mb-4">
            <h5>Company</h5>
            <ul className="list-unstyled">
              {["About", "Product", "Pricing", "Referral Programme", "Careers", "Zerodha tech", "Press & media", "Zerodha Cares (CSR)"].map((item, i) => (
                <li key={i} className="mt-2">
                  <a href="#" className="text-light text-decoration-none">
                    {item}
                  </a>
                </li>
              ))}
            </ul>
          </div>

          {/* Column 3 */}
          <div className="col-md-2 mb-4">
            <h5>Support</h5>
            <ul className="list-unstyled">
              {["Contact", "Support Portal", "Z-Connect blogs", "List of Charges", "Download & resources"].map((item, i) => (
                <li key={i} className="mt-2">
                  <a href="#" className="text-light text-decoration-none">
                    {item}
                  </a>
                </li>
              ))}
            </ul>
          </div>

          {/* Column 4 */}
          <div className="col-md-2 mb-4">
            <h5>Account</h5>
            <ul className="list-unstyled">
              {["Open an account", "Fund Transfer", "60 days challenge"].map((item, i) => (
                <li key={i} className="mt-2">
                  <a href="#" className="text-light text-decoration-none">
                    {item}
                  </a>
                </li>
              ))}
            </ul>
          </div>

          {/* Column 5 - Disclosure */}
          <div className="col-md-3 mb-4">
            <p style={{ fontSize: "12px" }} className="text-muted">
              Zerodha Broking Ltd.: Member of NSE, BSE & MCX – SEBI Reg. no.: INZ000031633. CDSL/NSDL Depository services – Reg. no.: IN-DP-431-2019. Registered office: #153/154, 4th Cross, Dollars Colony, Bengaluru – 560078.
            </p>
          </div>
        </div>
      </div>

      {/* Bottom Footer */}
      <div className="footer-bottom py-3" style={{ backgroundColor: "#2b3b45" }}>
        <div className="container d-flex flex-column flex-md-row justify-content-between align-items-center">
          <div className="mb-2 mb-md-0">
            {["Privacy Policy", "Terms of Use", "Risk Disclosure", "Grievance Mechanism"].map((text, i) => (
              <a
                key={i}
                href="#"
                className="text-light mx-2 text-decoration-none"
                style={{ fontSize: "0.9rem" }}
              >
                {text}
              </a>
            ))}
          </div>
          <div>
            {social.map(({ Icon, url }, i) => (
              <a key={i} href={url} target="_blank" rel="noopener noreferrer" className="text-light mx-2">
                <Icon size={20} />
              </a>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Footer;
